import React from "react";
import "./css/homepage.css"

function Homepage () {
    useEffect(() => {
        const configuration = {
            method: "post",
            url: "http://localhost:4000/users",
          };
          axios(configuration)
          .then((result) => {
            setLogin(true);
            return result;
          })
          .catch((error) => {
            error = new Error();
          });
        setTimeout(() => {
          setCount((count) => count + 1);
        }, 1000);
      });
    

    return(
        <div className="homebody">
            <h1>Home Page</h1>

        </div>
    )
}

export default Homepage;
